    def get_qsold(self):
        qsold = dict()
        for row in self.db_cursor.execute('SELECT * FROM sold_inventory'):
            if row[UPC_INDEX] in qsold:
                qsold[row[UPC_INDEX]] += 1
            else:
                qsold[row[UPC_INDEX]] = 1
        return qsold
            
    def get_qoh(self):
        qoh = dict()
        for row in self.db_cursor.execute('SELECT * FROM inventory'):
            if row[UPC_INDEX] in qoh:
                qoh[row[UPC_INDEX]] += 1
            else:
                qoh[row[UPC_INDEX]] = 1
        return qoh

